import './App.css';
import Menu from './Menu';
import { useState } from 'react';
import MainContent from './MainContent';
import Title from './practica_2/components/Title';
import Body from './practica_2/components/Body';

function App({pageBody, pageTitle}) {
  const [practiceSelected, setPracticeSelected] = useState('#practica_1');

  return (
    <div>
      <Body>{pageBody}</Body>
      <Menu onOptionSelected={(t) => { setPracticeSelected(t) }} />
      <MainContent practiceSelected={practiceSelected} />
    </div>
  );
}

export default App;
